import React from "react";
import "./Productsandservices.css";

const Productsandservices = () => {
  return (
    <>
      <div className="mainps">
        <div className="heading">
          <h1>PRODUCTS</h1>
        </div>
        <div className="granularurea">
          <img src="./images/products/granularurea.png" alt="" />
          hr
          <h1>Granular Urea</h1>
          <p>
            Granular urea is a valuable solid nitrogen fertilizer that boasts
            small, uniform granules with a pristine white, crystalline
            appearance. Packed with a high percentage of nitrogen, it serves as
            an essential nutrient for plant growth.
          </p>
        </div>
      </div>
    </>
  );
};

export default Productsandservices;
